import {Project} from "../interfaces/iProject"

export interface IPropsMainMenu {
    project: Project
}

export const MainMenu = (props: IPropsMainMenu) => {

    let dayInfo = new Date()

    setInterval(() => {

            dayInfo = new Date()
        }, 10000
    )

    return <ul>
        <li>{props.project.name}</li>
        <li>{dayInfo.toLocaleTimeString()}</li>
        <li>Time</li>
        <li>Projects</li>
        <li>Reports</li>
    </ul>
}
